import back from "@/components/Botton/back.vue";
import { apiIsSatisfyMemApplyClub, apiGetClubBaseDataConfing } from "@/api/Club.js";
export default {
  components: {
    back: back
  },
  data: function data() {
    return {
      meetConditionsAlert: false,
      // dataMemApplyClub:{
      //   UName: ""
      // },
      isSatisfyMessage: "",
      RankId: "",
      clubBaseData: ""
    };
  },
  created: function created() {
    // this.dataMemApplyClub.UName = localStorage.getItem("uname");
    this.RankId = localStorage.getItem("RankId");
    this.GetClubBaseDataConfing();
  },
  methods: {
    IsSatisfyMemApplyClub: function IsSatisfyMemApplyClub() {
      var _this = this;

      apiIsSatisfyMemApplyClub("", true).then(function (res) {
        if (Math.abs(res.Code) >= 600) {
          _this.meetConditionsAlert = true;
          _this.isSatisfyMessage = res.Message;
        } else {
          _this.$router.push("/CreateClubSet");
        }
      });
    },
    goDeposit: function goDeposit() {
      this.$router.push("/recharge");
    },
    noGo: function noGo() {
      var m = this.$message({
        message: this.$t('NotYetOpen'),
        //【 暂未开放 】
        type: "warning",
        center: true,
        duration: 1200,
        UName: "no namends"
      });
      setTimeout(function () {
        return m.close();
      }, 1200);
    },
    GetClubBaseDataConfing: function GetClubBaseDataConfing() {
      var _this2 = this;

      apiGetClubBaseDataConfing("", true).then(function (res) {
        _this2.clubBaseData = res.Data;
      });
    }
  }
};
